syntax = "proto3";

package gorender.testdata;

option go_package = "github.com/smartystreets/assertions/internal/go-render/render/testdata";

message Msg {
  int64 i64 = 1;
  Inner inner = 2;
}

message Inner {
  int32 i32 = 1;
}
